    t(-999.99, -0.99, '-0.09');
    t(999.99, '3.01', '0.67');
    t(-999.99, '3.01', '-0.67');
    t(1, '0.09', '0.01');
    Test.areEqual('0', new BigNumber(1).mod('-0.0001').valueOf());
    Test.areEqual('-0', new BigNumber(-0).mod(1).valueOf());
    Test.areEqual('-0', new BigNumber(-0).mod(0.1).valueOf());
    Test.areEqual('-0', new BigNumber('-0').mod('-1').valueOf());
